import React from 'react';

const SearchBar = () => {
    
    return(
        <ReactSearchBox
            placeholder="ค้นหาจากไอดี"
            data={''}
            onSelect={record => console.log(record)}
            onFocus={() => {
            console.log('This function is called when is focussed')
            }}
            onChange={value => console.log(value)}
            fuseConfigs={{
            threshold: 0.05,
            }}
        value=""
        />
    );
}

export default SearchBar;
